  "body": "The visual design of the Air Max 95 was created by Sergio Lozano, who based the design of the Air Max 95 on the human anatomy, with the spine of the shoe resembling the human spine and the materials intended to represent skin, ribs, and tendons.[6] The Air Max 95 was the first pair in the line to utilize two air cushions in the forefoot and used air pressure technology to fit the curvature of the wearer's forefoot.[7] The first colorway was black, neon yellow and white. Neon yellow was used to emphasize the multiple air units. The shoe also introduced a smaller Nike swoosh minimized in the rear side panel. Original releases featured a 25 PSI air pressure reading on the rear air unit. Uppers also featured 3M Scotchlite material. The product was referenced in the hip hop song Hate It or Love It by The Game, which was a worldwide top 10 hit in 2005. Also referenced by rappers Gucci Mane in the hit single Bricks and Waka Flocka Flame on the track Head First in his 2009 mixtape, Lebron Flocka James. The rapper Eminem designed a limited-edition range of Air Maxes sold for charity.",
